import React from "react";
import { Card } from "../share-components/Cards/Card";
import styled from "styled-components";
import { SkillCard } from "../share-components/Cards/SkillCard";

class Homepage extends React.Component{
    render(){
        return(
        <Wrapper>
            <MainContainer>
                <Quote>Life is like a train station, if you miss it then just wait there will be another but do not ever stop. </Quote>
                <SocialMediaIcon>test</SocialMediaIcon>
            </MainContainer>
            <SkillContainer>
                <LanguageContainer>
                    <SkillCard >Javascript</SkillCard>
                </LanguageContainer>
                <CardContainer>
                    <Card image="testing">UI/UX</Card>
                    <Card image="testing">Web Developer</Card>
                    <Card image="testing">Software Developer</Card>
                </CardContainer>
            </SkillContainer>
        </Wrapper>
        )
    }
}

export {Homepage}

const Wrapper = styled.div`width:auto`;

const Quote = styled.h1`
width:40%;
margin: 4% 5%;
color:#F5B716;
`

const MainContainer = styled.div`
height:auto;
min-height: 35em;
border:2px solid black;
background-color:#434242;
`;

const SkillContainer = styled.div`
display:flex;
flex-direction:row;
height:auto;
min-height: 10em;
border:2px solid black;
`

const LanguageContainer = styled.div``;

const CardContainer = styled.div`
display:flex;
flex-direction:row;
`;

const SocialMediaIcon = styled.div``;
